import React from 'react';// JavaScript Document
import './CSS/blog.css';
import video from "../assests/finance.mp4";


function blog() {
	return(
	<>

<div className="blog1">
<video width="320" height="240" autoplay muted>
  <source src={video} type="video/mp4"></source>

</video>

</div>




	</>
     )
};

export default blog;
